import React from "react";
import myImage from "../image/pic2.jpg";

function LoginComp() {
  return (
    <div>
      <div className="absolute top-8 left-72">
        <img
          src={myImage}
          alt="Illustration of a person logging into the system"
          className="w-4/5 rounded-xl shadow-lg drop-shadow-lg"
        />
      </div>
      <div className="absolute top-32 left-96 translate-x-7 w-1/2 h-2/3 bg-black bg-opacity-70 drop-shadow-xl rounded-2xl">
        <h1 className="text-white text-3xl font-serif font-bold absolute left-80 translate-x-3 top-4">
          LOGIN
        </h1>
        <div>
          <input className="bg-gray-900 bg-opacity-80 absolute top-8 left-16 h-8 w-2/3" type="email" placeholder="Email" id="search" ></input>
        </div>
      </div>
    </div>
  );
}

export default LoginComp;
